import React from 'react';
import Background from '../assets/svg/footer/Background.svg'

const Footer: React.FC = () => {
    return (
        <footer>
            <img src={Background} style={{ width: '100%', scale: '0.7'}}>

            </img>
        </footer>
    );
};

export default Footer;
